webpackJsonp([0x85631847cc3d],{3973:function(e,o){e.exports={data:{markdownRemark:{html:'<h2>Hexcodes</h2>\n<p>In mathematics and computing, hexadecimal (also base 16, or hex) is a positional numeral system with a radix, or base, of 16. It uses sixteen distinct symbols, most often the symbols 0â€“9 to represent values zero to nine, and A, B, C, D, E, F (or alternatively a, b, c, d, e, f) to represent values ten to fifteen.</p>\n<p>Hex colors are broken up into six hexadecimal digits. There are three sections - Red, Green, and Blue (in that order). Each section is a number from 00 to FF. The higher the number/letter, the more of that color you have.</p>\n<p>There are 16,777,216 possible color combinations using hexcode.</p>\n<h4>Examples:</h4>\n<p>Pure red is FF0000\nPure green is 00FF00\nPure blue is 0000FF\nBlack is 000000\nWhite is FFFFFF</p>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ul>\n<li><a href="https://en.wikipedia.org/wiki/Hexadecimal">Wikipedia article about Hexadecimal code</a></li>\n<li><a href="https://en.wikipedia.org/wiki/Web_colors">Wikipedia article about web colors</a></li>\n<li><a href="http://www.color-hex.com/">Hex Colors</a></li>\n<li><a href="https://medium.com/webkul-dev/hex-color-codes-27cd0a37c3ce">Medium article on hex color code</a></li>\n<li><a href="https://developer.mozilla.org/en-US/docs/Web/CSS/color_value">More information on colors in CSS</a></li>\n<li><a href="http://www.colorhexa.com/">Explore different Hex colors</a></li>\n</ul>',fields:{slug:"/computer-science/hexcode/"},frontmatter:{title:"Hexcode"}}},pathContext:{slug:"/computer-science/hexcode/"}}}});
